import React from "react"
import styled from "styled-components"

const Delete_popup_container = styled.div`
    position: absolute;
    top: ${props => props.top};
`

const Delete_popup = () => {

    const [Delete_popup_height, setDelete_popup_state] = useState(false)

    return <React.Fragment>

    <Delete_popup_container
        top={Delete_popup_height}
    >
        <div>
            <span>Are you sure you want to delete this review?</span>
        </div>
    </Delete_popup_container>

    </React.Fragment>

}

export default Delete_popup
